import React from 'react';
import './navbar.css';
import { Dropdown } from 'react-bootstrap'; // Importing Dropdown from react-bootstrap
import day_logo from '../../assets/day.png';
import light_person from '../../assets/person_light.png';

const CustomNavbar = () => {
  return (
    <div className="container">
      <Dropdown>
        {/* Use a button for Dropdown.Toggle and apply custom styling */}
        <Dropdown.Toggle id="dropdown-custom-components" as="div" className="dropdown-toggle-custom">
          <img src={light_person} alt="profile" className="toggle-icon" />
        </Dropdown.Toggle>

        <Dropdown.Menu>
          <Dropdown.Item href="#profile">Profile</Dropdown.Item>
          <Dropdown.Item href="#settings">Settings</Dropdown.Item>
          <Dropdown.Divider />
          <Dropdown.Item href="#logout">Logout</Dropdown.Item>
        </Dropdown.Menu>
      </Dropdown>

      <img src={day_logo} alt="" className="toggle-icon" />
    </div>
  );
};

export default CustomNavbar;
